const Custos = ({ notas }) => {
  return (
    <div className="main">
      {notas.map((nota) => (
        <div className="nota">
          <h3>{nota.corretora}</h3>
          <h3>{nota.data}</h3>
          <h3>{nota.folha}</h3>
          <h3>{nota["nr. nota"]}</h3>
          <h3>{nota.Custos.Total}</h3>
          {nota.Negocios.map((negocio) => {
            <div className="negocios">
              <h2>{negocio["Negociação"]}</h2>
              <h2>{negocio["C/V"]}</h2>
              <h2>{negocio["Tipo de mercado"]}</h2>
              <h2>{negocio["Nome Pregão"]}</h2>
              <h2>{negocio["Quantidade"]}</h2>
              <h2>{negocio["Preço"]}</h2>
              <h2>{negocio["Valor Operação"]}</h2>
              <h2>{negocio["D/C"]}</h2>
              <h2>{negocio["Código"]}</h2>
            </div>;
          })}
        </div>
      ))}
    </div>
  );
};

export default Custos;
